import React from 'react'

const EVENTS = [
  { id: 1, name: 'Event 1', date: '2022-01-01' },
  { id: 2, name: 'Event 2', date: '2022-01-15' },
];

const EventsPage = () => {
  return (
    <>
    <EventList events={Eve}/>
    </>
  )
}

export default EventsPage
